规则

views  >  [menuFiles|PageFiles]: src/views下只能创建菜单级文件夹或PageFiles
menuFiles  >  routers.js + pageFiles: 菜单文件下只能创建两类型文件 路由文件 + 页面文件夹
pageFiles  >  components + img + router.js + page.vue : 页面级文件夹下可以视为小型项目，采取【资源就近】的原则

路由
问题场景：
 1.  manage 1.0 项目, 路由数量多, 却集成在一个页面, 增删改很费事，在开发同一个项目时同时新增路由可能会造成代码冲突
 2. 大数量的路由在做项目分割时无法确定路由对应文件是否在用, 导致 1.0 路由是分割了, 业务文件不敢删减
 3. 路由文件和业务文件不在同一层级, 不能直观的确认路由对应多少页面
解决办法：

路由最终还是 src/routers.js 内， 那唯一能做的就是分布式处理。引入 ES6 解构赋值 完美实现
以 menuFiles 的维度去 解构赋值，既可以在当前 file 内确认路由对应文件，也利于新的菜单创建和分割
menuFiles 中的 路由 文件属于私有文件，统一命名为 _routers.js, 也可以保证菜单文件内的路由文件保持在最显眼的位置

